script: |
  super -f text -I q5866.spq | sort > q5866.out

inputs:
  - name: q5866.spq
    data: |
      SELECT ALL - + col2 FROM tab2 (FORMAT parquet) WHERE NOT + - col2 * + + col2 BETWEEN + - 9 AND - CAST ( - 60 AS INTEGER );
  - name: tab2

outputs:
  - name: q5866.out
    data: |
      -23
      -40
      -58
